import React, { useState } from 'react';

function Analytics() {
  const [filters, setFilters] = useState({
    location: '',
    qrId: '',
    startDate: '',
    endDate: '',
    browser: '',
    deviceType: '',
    os: '',
    repeatFrequency: ''
  });

  const [dropdownOpen, setDropdownOpen] = useState(false);
  const [selectedFilter, setSelectedFilter] = useState(null);
  const [selectedRows, setSelectedRows] = useState([]);

  // Sample data for demonstration purposes
  const tableData = [
    { id: 1, location: 'New York, USA', ip: '192.168.0.1', qrId: 'QR12345', scanTime: '2024-11-08 10:30 AM', url: 'www.example.com/scan', browser: 'Chrome', deviceType: 'Mobile', os: 'Android 13', repeatFrequency: 'Once' },
    { id: 2, location: 'London, UK', ip: '203.0.113.5', qrId: 'QR67890', scanTime: '2024-11-08 11:15 AM', url: 'www.example.com/scan', browser: 'Safari', deviceType: 'Desktop', os: 'macOS 12', repeatFrequency: 'Twice' },
    // Additional rows...
  ];

  const toggleDropdown = () => {
    setDropdownOpen(!dropdownOpen);
  };

  const handleFilterSelect = (filter) => {
    setSelectedFilter(filter);
    setDropdownOpen(false);
    console.log("Selected filter:", filter);
  };

  const handleRowSelect = (event, rowId) => {
    if (event.target.checked) {
      setSelectedRows([...selectedRows, rowId]);
    } else {
      setSelectedRows(selectedRows.filter(id => id !== rowId));
    }
  };

  return (
    <div className="page-content">
      {/* start page title */}
      <div className="page-title-box">
        <div className="container-fluid">
          <div className="row align-items-center">
            <div className="col-sm-6">
              <div className="page-title">
                <h4>Analytics Table</h4>
              </div>
            </div>
            <div className="col-sm-6 text-right">
              <div className="dropdown">
                <button
                  className="btn btn-secondary dropdown-toggle"
                  type="button"
                  onClick={toggleDropdown}
                  aria-expanded={dropdownOpen ? "true" : "false"}
                >
                  Filter {selectedFilter ? `(${selectedFilter})` : ""}
                </button>
                <div className={`dropdown-menu ${dropdownOpen ? "show" : ""}`}>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Location')}>Location</button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('QR Code ID')}>QR Code ID</button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Browser')}>Browser</button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Device Type')}>Device Type</button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('Operating System')}>Operating System</button>
                  <button className="dropdown-item" onClick={() => handleFilterSelect('User Repeat Frequency')}>User Repeat Frequency</button>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
      {/* end page title */}

      {/* Table Section */}
      <div className="container-fluid">
        <div className="page-content-wrapper">
          <div className="row">
            <div className="col-12">
              <div className="card">
                <div className="card-body">
                  <div className="table-rep-plugin">
                    <div className="table-responsive mb-0" data-pattern="priority-columns">
                      <table id="analytics-table" className="table table-striped">
                        <thead>
                          <tr>
                            <th>
                              <input
                                type="checkbox"
                                onChange={(e) => {
                                  if (e.target.checked) {
                                    setSelectedRows(tableData.map(row => row.id));
                                  } else {
                                    setSelectedRows([]);
                                  }
                                }}
                              />
                            </th>
                            <th>Location</th>
                            <th>IP Address</th>
                            <th>QR Code ID</th>
                            <th>Scan Time</th>
                            <th>Reference URL</th>
                            <th>Browser</th>
                            <th>Device Type</th>
                            <th>Operating System</th>
                            <th>User Repeat Frequency</th>
                          </tr>
                        </thead>
                        <tbody>
                          {tableData.map(row => (
                            <tr key={row.id}>
                              <td>
                                <input
                                  type="checkbox"
                                  checked={selectedRows.includes(row.id)}
                                  onChange={(e) => handleRowSelect(e, row.id)}
                                />
                              </td>
                              <td>{row.location}</td>
                              <td>{row.ip}</td>
                              <td>{row.qrId}</td>
                              <td>{row.scanTime}</td>
                              <td>{row.url}</td>
                              <td>{row.browser}</td>
                              <td>{row.deviceType}</td>
                              <td>{row.os}</td>
                              <td>{row.repeatFrequency}</td>
                            </tr>
                          ))}
                        </tbody>
                      </table>
                    </div>
                  </div>
                </div>
              </div>
            </div> {/* end col */}
          </div> {/* end row */}
        </div>
      </div> {/* container-fluid */}
    </div>
  );
}

export default Analytics;
